import React from 'react';
import Header from './components/Header';
import HeaderNav from './components/HeaderNav';
import Sidebar from './components/Sidebar';
import Map from './components/Map.js';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <div className="content">
        <Sidebar />
        <Map />
      </div>
    </div>
  );
}

export default App;
